        return false;
    }
    const [x, mod] = [Math.floor(matchsticks.reduce((a, b) => a + b) / 4), matchsticks.reduce((a, b) => a + b) % 4];
    if (mod !== 0 || x < Math.max(...matchsticks)) {
        return false;
    }
    const edges = [0, 0, 0, 0];
    matchsticks.sort((a, b) => b - a);
    return dfs(0);
